import DeckForm from "./DeckForm";

const NewDeck = () => {
    return (
        <div>
            <nav aria-label="breadcrumb">
            <ol className="breadcrumb">
                <li className="breadcrumb-item">
                    <Link to={"/"} className="btn btn-link">Go Home</Link>
                </li>
            </ol>
            </nav>
            <div>
                <DeckForm />
            </div>
        </div>
    )
}

export default NewDeck;
